import React from 'react';
import '../styles/Home.css';
import Navbar from './Navbar';
import { useNavigate } from 'react-router-dom';


function MyComponent() {
  const useNavigate = useNavigate();
}


function Home() {
  return (
    <>
    <Navbar/>
    <div className="home-container">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-background">
          <img 
            src="https://images.unsplash.com/photo-1542291026-7eec264c27ff?w=1200&h=600&fit=crop" 
            alt="Hero Banner" 
            className="hero-image"
            />
        </div>

        <div className="hero-content">
          <p className="hero-subtitle">Only one way to find out.</p>
          <h2 className="hero-tagline">JUST DO IT.</h2>
            
    <button onClick={() => navigate('/products')}>Shop</button>

        </div>

        <div className="hero-controls">
          <div className="dot-indicators">
            <span className="dot active"></span>
            <span className="dot"></span>
          </div>
          <div className="nav-arrows">
            <button className="arrow-btn prev">‹</button>
            <button className="arrow-btn next">›</button>
          </div>
        </div>
      </section>
    </div>
            </>
  );
}

export default Home;
